import css from "styled-jsx/css";

export default css`
  header {
    display: flex;
  }
  ul {
    display: flex;
    width: 100vh;
    justify-content: space-around;
    list-style: none;
    font-family: Verdana;
    border-bottom: 1px solid lightgrey;
  }

  a {
    text-decoration: none;
    text-align: center;
    color: black;
  }

  a:visited {
    color: grey;
  }

  li {
    padding-top: 2px;
    padding-bottom: 2px;
    width: 8rem;
    align-items: center;
  }

  li:hover {
    padding-top: 0;
    border-top: 2px solid grey;
  }
`;
